const ListTodos = () => {
  const getTodos = async () => {
    try {
      const response = await fetch('http://localhost:5000/todos');
      const data = await response.json();

      console.log(data);
    } catch (err) {
      console.log(err);
    }
  }

  useEffect(() => {
    getTodos();
  })
  return (
    <>
      <table className="table mt-5 text-center">
        <thead>
          <tr>
            <th>Description</th>
            <th>Edit</th>
            <th>Delete</th>
          </tr>
        </thead>
        <tbody>
          {/* <tr>
            <td>John</td>
            <td>Doe</td>
            <td>john@example.com</td>
          </tr> */}
        </tbody>
      </table>
    </>
  )
}

